import "./App.css";
import Header from "./components/Header";
import VideoStreamer from "./components/VideoStreamer";
import { AppBar, Toolbar } from "@mui/material";

function App() {
    return (
        <div>
            <AppBar position="static" />
            <Header />
            <hr />
            <VideoStreamer />
        </div>
    );
}

export default App;
